import React from 'react';

const layoutStyle = {
    width: '640px',
    margin: '20px auto',
}

function Layout({ children }) {
    return (
        <div
            className="layout"
            style={ layoutStyle }>
            <main>
                { children }
            </main>
        </div>
    )
}

export default Layout;
